import React from 'react';
import AddAddress from "./add_address";
import {connect} from "react-redux";
import {UpdateStatusFalse, UpdateStatusTrue} from "../../../../../redux/inputTextReducer";
import InputSelect from "../input_select/input_select";

class InputTextContainer extends React.Component{

    UpdateTrue=()=>{
        this.props.UpdateStatusTrue();
    }
    render() {
        return <InputSelect address={this.props.addressPage} updateTrue={this.props.UpdateTrue}/>
    }
}
let mapStateToProps=(state)=>{
    return{
        addressPage:state.Address
    }

}
const InputSelectContainerExport = connect(mapStateToProps,{UpdateStatusTrue,UpdateStatusFalse})(InputTextContainer);
export default InputSelectContainerExport;
